import React, { useState } from "react";
import ViewGraph from "./ViewGraph";
import AlertPopup from "./AlertPopup";

function GraphComponent() {
  const data = [
    { graphName: "Graph 1", stsName: "Tuning Set 1" },
    { graphName: "Graph 2", stsName: "Tuning Set 1" },
    { graphName: "Graph 3", stsName: "Tuning Set 2" },
  ];

  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(true);
  };

  return (
    <div className="form">
      <h4>Graph</h4>
      <br />
      <br />
      <br />
      <table className="table">
        <thead>
          <tr>
            <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
              Graph Name
            </th>
            <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
              STS Name
            </th>
            <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
              Actions
            </th>
          </tr>
        </thead>
        <tbody>
          {data.map((dra, index) => (
            <tr key={index}>
              <td>{dra.graphName}</td>
              <td>{dra.stsName}</td>
              <td>
                <button className="btn" onClick={() => setIsClicked(true)}>
                  View Graph
                </button>
                {isClicked === "false" && <ViewGraph />}
                &emsp; &emsp; &emsp;
                <button className="btn-red">Delete Graph</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <br />
    </div>
  );
}

export default GraphComponent;
